import React from 'react';

function CardAtleta({ atleta }) {
  // Verifica se o atleta é válido
  if (!atleta || Object.keys(atleta).length === 0) {
    return null;
  }

  return (
    <div className="card">
      <h1>{atleta.player_name}</h1>
      <p>
        Idade: {atleta.player_age} | País: {atleta.player_country} | Posição: {atleta.player_type} | Time: {atleta.team_name}
      </p>
    </div>
  );
}

export default CardAtleta;
